import React from "react"
import './App.css';
import Flashcards from "./Flashcard";

import Header from "./Header"

function App(){
  return (
    <html className="App">

      <header>
        <Header />
      </header>
      <div className="Background"></div>

      <Header />

      <Flashcards />

    </html>
  )
}

export default App;
